import React, { useEffect } from 'react';

export const Hero = () => {
  useEffect(() => {
    const canvas = document.getElementById('canvas');
    const canvasRender2DSettings = { willReadFrequently: true };
    const ctx = canvas.getContext('2d', canvasRender2DSettings);

    const setCanvasSize = () => {
      canvas.width = window.innerWidth;
      canvas.height = window.innerHeight;
    };

    setCanvasSize();

    class Particle {
      constructor(effect, x, y, color) {
        this.effect = effect;
        this.x = Math.random() * this.effect.width;
        this.y = Math.random() * this.effect.height;
        this.originX = Math.floor(x);
        this.originY = Math.floor(y);
        this.color = color;
        this.size = this.effect.gap;
        this.vx = 0;
        this.vy = 0;
        this.ease = 0.2; // Speed of animation
        this.friction = 0.95;
        this.dx = 0;
        this.dy = 0;
        this.distance = 0;
        this.force = 0;
        this.angle = 0;
      }
      draw(context) {
        context.fillStyle = this.color;
        context.fillRect(this.x, this.y, this.size, this.size);
      }
      update() {
        this.dx = this.effect.mouse.x - this.x;
        this.dy = this.effect.mouse.y - this.y;

        this.distance = this.dx * this.dx + this.dy * this.dy;
        this.force = -this.effect.mouse.radius / this.distance;

        if (this.distance < this.effect.mouse.radius) {
          this.angle = Math.atan2(this.dy, this.dx);
          this.vx += this.force * Math.cos(this.angle);
          this.vy += this.force * Math.sin(this.angle);
        }
        this.x +=
          (this.vx *= this.friction) + (this.originX - this.x) * this.ease;
        this.y +=
          (this.vy *= this.friction) + (this.originY - this.y) * this.ease;
      }
      warp() {
        this.x = Math.random() * this.effect.width;
        this.y = Math.random() * this.effect.height;
        this.ease = 0.02;
      }
    }

    class Effect {
      constructor(width, height) {
        this.width = width;
        this.height = height;
        this.particlesArray = [];
        this.image = document.getElementById('heroimg');
        this.centerX = this.width * 0.5;
        this.centerY = this.height * 0.4;
        this.x = this.centerX - this.image.width * 0.5;
        this.y = this.centerY - this.image.height * 0.5;
        this.gap = 2;
        this.mouse = {
          radius: 3000,
          x: undefined,
          y: undefined,
        };
        window.addEventListener('mousemove', event => {
          this.mouse.x = event.x;
          this.mouse.y = event.y;
        });
      }
      init(context) {
        context.drawImage(this.image, this.x, this.y);
        const pixels = context.getImageData(0, 0, this.width, this.height).data;
        for (let y = 0; y < this.height; y += this.gap) {
          for (let x = 0; x < this.width; x += this.gap) {
            const index = (y * this.width + x) * 4;
            const red = pixels[index];
            const green = pixels[index + 1];
            const blue = pixels[index + 2];
            const alpha = pixels[index + 3];
            const color = 'rgb(' + red + ',' + green + ',' + blue + ')';
            if (alpha > 0) {
              this.particlesArray.push(new Particle(this, x, y, color));
            }
          }
        }
      }
      draw(context) {
        this.particlesArray.forEach(particle => particle.draw(context));
      }
      update() {
        this.particlesArray.forEach(particle => particle.update());
      }
      warp() {
        this.particlesArray.forEach(particle => particle.warp());
      }
    }

    const createEffect = () => {
      const effect = new Effect(canvas.width, canvas.height);
      effect.init(ctx);
      return effect;
    };

    let effect = createEffect();

    const handleResize = () => {
      setCanvasSize();
      effect = createEffect();
    };

    window.addEventListener('resize', handleResize);

    const animate = () => {
      ctx.clearRect(0, 0, canvas.width, canvas.height);
      effect.draw(ctx);
      effect.update();
      requestAnimationFrame(animate);
    };
    //effect.warp();
    animate();

    return () => {
      window.removeEventListener('resize', handleResize);
    };
  }, []);

  return (
    <div className="relative w-full h-screen">
      <canvas
        id="canvas"
        className="absolute bg-zinc-900 w-full h-full"
      ></canvas>
      <img
        className="hidden"
        id="heroimg"
        alt="hero"
        src="data:image/png;base64,"
      />
      <button
        id="button"
        className="z-[100] absolute bottom-40 left-[50vw] -translate-x-[50%] text-white"
      >
        Warp
      </button>
    </div>
  );
};
